import React, {useEffect} from 'react';
import {useDispatch, useSelector} from 'react-redux';
import {Row, Col} from 'antd'; 
const SignIn = () => {
    const dispatch = useDispatch();
    const user = useSelector(selector => selector.user); 
    useEffect( () => {
        console.log(user); 
    })
    return (
        <>
            <Row gutter={24}>
                <Col span={12} order={1}>
                    SignIn
                </Col>
                <Col span={12} order={2}>
                    SignUp
                </Col>
            </Row>
        </>
    )
};

export default SignIn;
